import React from "react";
import { useSelector } from "react-redux";
import { BG_IMAGE } from "../../services/urlsservice";

const GptMovieSuggestions = () => {
  const selector = useSelector((state) => state.gpt.searchMovies);

  if (!selector)
    return (
      <div className="h-96 md:h-10">
        <img className="h-96 md:h-screen" src={BG_IMAGE} />{" "}
      </div>
    )
  return <div className="h-screen bg-yellow-400"></div>;
};

export default GptMovieSuggestions;
